import { styled } from "styled-components"

const AddButtonStyles = styled.button`
	color: #0e65a3;
  background-color: white;
  padding: 0 10px;
  border-radius: 10px;  
`
export default function AddButton() {

  return (
    <AddButtonStyles type='submit'>Add</AddButtonStyles>
  )
}
